var myApp=angular.module("myApp",[]),from="USD",to="EUR";myApp.controller("CurrencyController",["$scope","$http",function(a,b){a.heading="Enter Amount: ",a.convert=function(a){from=a.slice(0,3),to=a.slice(3),b.get("/currency/get?from="+from+"&to="+to).success(function(a){console.log(a.rate)})}}]);